import React, { Component } from 'react'

export default class Historia extends Component {
    render() {
        return (
            <div class="card" style="width: 18rem;">
                <img class="card-img" src="https://rolloid.net/wp-content/uploads/2016/03/Que-sienten-las-personas-que-sufren-ansiedad-01.jpg" alt="Card image cap" />
                
            </div>
            
        )
    }
}
